"use strict";function toggleActiveClass(e){for(var t=document.getElementsByClassName("tab"),n=0;n<t.length;n++)t[n]!==e&&t[n].classList.remove("active");e.classList.toggle("active")}function createLinks(){if(document.getElementById("TOC")){var e=document.querySelectorAll(".page h2");if(2<=e.length){for(var t=document.getElementById("TOC"),n="",a=0;a<e.length;a++){n+='<a href="#anchor_'+a+'">',n+=e[a].innerHTML,n+="</a>";var l=document.createElement("span");l.setAttribute("id","anchor_"+a),e[a].appendChild(l)}t.innerHTML=""+n}else document.getElementById("TOC").style.display="none"}}console.log("Javascript loaded !"),window.onload=createLinks();